import React from "react";
import {Link } from 'react-router-dom';

function Nav() {
  return (
    <>
      <nav className="nav">
        <Link to="/" exact>Home</Link>
        <Link to="/skill">Skill</Link>
        <Link to="/projects">Projects</Link>
        <Link to="/contact">Contact</Link>
      </nav>
    </>
  );
}

export default Nav;
